
let products = [
    { name: "Café Expresso", price: 5, category: "Café", cafeteria: "Café do Centro", img: "data:image/jpeg;base64," },
    { name: "Pão de Queijo", price: 4, category: "Pão de Queijo", cafeteria: "Mineiro Café", img: "data:image/jpeg;base64," },
    { name: "Chá de Camomila", price: 6, category: "Chá", cafeteria: "Chá & Prosa", img: "data:image/jpeg;base64," },
    { name: "Água Mineral", price: 3, category: "Água", cafeteria: "Café Urbano", img: "data:image/jpeg;base64," },
    { name: "Café com Leite", price: 6, category: "Café", cafeteria: "Bule Dourado", img: "data:image/jpeg;base64," },
    { name: "Croissant", price: 7, category: "Pão de Queijo", cafeteria: "Padoca Café", img: "data:image/jpeg;base64," }
];

let cart = [];
let currentProduct = {};
let quantity = 1;

function showPage(id) {
    document.querySelectorAll('.page').forEach(p => p.classList.remove('active'));
    document.getElementById(id).classList.add('active');
}

function renderProducts(list) {
    const container = document.getElementById('product-list');
    container.innerHTML = '';
    list.forEach(p => {
        const card = document.createElement('div');
        card.className = 'product-card';
        card.innerHTML = `<img src="${p.img}" alt="${p.name}">
                          <h3>${p.name}</h3>
                          <p>${p.cafeteria}</p>
                          <p>R$ ${p.price},00</p>
                          <button onclick='showDetails(${JSON.stringify(p)})'>Ver</button>`;
        container.appendChild(card);
    });
}

function showDetails(p) {
    currentProduct = p;
    quantity = 1;
    document.getElementById('detail-img').src = p.img;
    document.getElementById('detail-name').textContent = p.name;
    document.getElementById('detail-cafeteria').textContent = p.cafeteria;
    document.getElementById('detail-price').textContent = `R$ ${p.price},00`;
    document.getElementById('quantity').textContent = quantity;
    showPage('details');
}

function changeQuantity(q) {
    quantity = Math.max(1, quantity + q);
    document.getElementById('quantity').textContent = quantity;
}

function addToCart() {
    cart.push({ ...currentProduct, quantity });
    showPage('cart');
    renderCart();
}

function renderCart() {
    const list = document.getElementById('cart-items');
    list.innerHTML = '';
    cart.forEach(item => {
        const li = document.createElement('li');
        li.textContent = `${item.quantity}x ${item.name} - ${item.cafeteria} - R$ ${item.price * item.quantity},00`;
        list.appendChild(li);
    });
}

function checkout() {
    alert('Pedido confirmado!');
    cart = [];
    renderCart();
}

function filterCategory(cat) {
    if (cat === 'Todos') renderProducts(products);
    else renderProducts(products.filter(p => p.category === cat));
}

document.addEventListener('DOMContentLoaded', () => {
    renderProducts(products);
    document.getElementById('whatsapp-link').href = "https://wa.me/5511999999999?text=Olá, estou acompanhando meu pedido!";
});
